import React from 'react';
import useElements from './apiHooks/useElements'
function App() {
  const { data, put, setid, deleting, SetnewPost } = useElements()
  return (
    <div>
      {data.map(i => {
        return (
          <div>
            <i.tag > {i.text}</i.tag>
            {i.src}
          </div>
        )
      })}
    </div >
  );
}

export default App;
